; (() => {
    const nameList = ["GB", "bday", "breakfast", "easter", "grumpy", "jacksnyan", "jazz", "mexinyan", "mummy", "nyan", "nyancoin", "nyaninja", "paddy", "pikanyan", "sadnyan", "slomo", "technyancolor", "uhmurica", "vday", "xmas", "zombie"];

    let timer = setInterval(() => {
        const statusItem = document.querySelector('div[title="Nyan Cat"] > a');

        if (!statusItem) return;
        else clearInterval(timer);

        nyan = document.createElement("span");

        let name = window.NyanCatConfiguration.name;
        if (name === 'random') name = nameList[Math.floor(Math.random() * nameList.length)];
        nyan.classList.add('nyan-cat', `nyan-cat-${name}`);

        injectCSS(NyanCatStyles()[name]);
        nyan.style.backgroundColor = window.NyanCatConfiguration.backgroundColor;
        statusItem.appendChild(nyan);
    }, 600);

    function injectCSS(dataUrl) {
        const style = document.createElement('STYLE');
        style.innerText = `
            .nyan-cat{
                width: 50px;
                height: 100%;
                background-repeat: no-repeat;
                background-size: contain;
                background-image: url(${dataUrl});
            }
            .nyan-cat-bday{
                background-position-y: -7px;
                background-size: 42px;
            }
            .nyan-cat-breakfast{
                background-position-y: 4px;
                background-size: 40px;
            }
            .nyan-cat-easter{
                background-position-y: 2px;
                background-size: 40px;
            }
            .nyan-cat-GB{
                background-position-y: 3px;
                background-size: 42px;
            }
            .nyan-cat-grumpy{
                background-position-y: 3px;
                background-size: 40px;
            }
            .nyan-cat-jacksnyan{
                background-position-y: 1px;
                background-size: 40px;
            }
            .nyan-cat-jazz{
                background-position-y: 3px;
                background-size: 42px;
            }
            .nyan-cat-mexinyan{
                background-position-y: 1px;
                background-size: 42px;
            }
            .nyan-cat-mummy{
                background-position-y: 3px;
                background-size: 42px;
            }
            .nyan-cat-nyan{
                background-position-y: 3px;
                background-size: 42px;
            }
            .nyan-cat-nyancoin{
                background-position-y: 2px;
                background-size: 42px;
            }
            .nyan-cat-nyaninja{
                background-position-y: 3px;
                background-size: 50px;
            }
            .nyan-cat-paddy{
                background-position-y: -1px;
                background-size: 36px;
            }
            .nyan-cat-pikanyan{
                background-position-y: 2px;
                background-size: 40px;
            }
            .nyan-cat-sadnyan{
                background-position-y: 3px;
                background-size: 42px;
            }
            .nyan-cat-slomo{
                background-position-y: 3px;
                background-size: 42px;
            }
            .nyan-cat-technyancolor{
                background-position-y: 3px;
                background-size: 42px;
            }
            .nyan-cat-uhmurica{
                background-position-y: 3px;
                background-size: 42px;
            }
            .nyan-cat-vday{
                background-position-y: 3px;
                background-size: 42px;
            }
            .nyan-cat-xmas{
                background-position-y: 1px;
                background-size: 36px;
            }
            .nyan-cat-zombie{
                background-position-y: 2px;
                background-size: 36px;
            }
        `;
        document.body.appendChild(style);
    }

    function NyanCatStyles() {
        return {
            bday: 'data:image/gif;base64,',
            breakfast: 'data:image/gif;base64,',
            easter: 'data:image/gif;base64,',
            GB: 'data:image/gif;base64,',
            grumpy: 'data:image/gif;base64,',
            jacksnyan: 'data:image/gif;base64,',
            jazz: 'data:image/gif;base64,',
            mexinyan: 'data:image/gif;base64,',
            mummy: 'data:image/gif;base64,',
            nyan: 'data:image/gif;base64,',
            nyancoin: 'data:image/gif;base64,',
            nyaninja: 'data:image/gif;base64,',
            paddy: 'data:image/gif;base64,',
            pikanyan: 'data:image/gif;base64,',
            sadnyan: 'data:image/gif;base64,',
            slomo: 'data:image/gif;base64,',
            technyancolor: 'data:image/gif;base64,',
            uhmurica: 'data:image/gif;base64,',
            vday: 'data:image/gif;base64,',
            xmas: 'data:image/gif;base64,',
            zombie: 'data:image/gif;base64,'
        }
    }
})();